('Yonex Percept 97D 320g', 'Rakieta tenisowa o wadze 320g (bez naciągu) oferuje wyjątkową kontrolę i maksymalne czucie. Model ten cechuje świetna manewrowość i pomimo wagi ponad 300g, rakieta nie będzie sprawiać problemów ambitnym amatorom. Isometric daje większe pole optymalnego trafienia piłki i większą tolerancję. Ta generacja rakiet Percept została zmodyfikowana: Flex Fuse, który wykorzystuje miękki polimer dla lepszego komfortu oraz VDM (Vibration Dampening Mesh) w uchwycie do niwelowania wibracji. Yonex Percept to rakieta dla graczy szukających wąskich ram i preferujących techniczny styl gry.', 'http://localhost:8081/img/Yonex-Vcore-Tour-1.617d7fcc.jpg', 340, 31.82, 68.6, 613, '16x20', '21-21-21', 62, 899.0),
